import React from "react";
import {BrowserRouter ,Link} from "react-router-dom";

const Nav=()=>{
    return(
        <nav>
            <ul>
                <BrowserRouter>
                    <Link to ="/"><li>Home</li></Link>
                    <Link to="/create-post"><li>Create A Post</li></Link>
                    <Link to="/show-posts"><li>Show Current Posts</li></Link>
                </BrowserRouter>
            </ul>
        </nav>
    )
}
export default Nav;
